import React from 'react';
import styles from './SignIn.module.css';

const SignIn = () => {
  return (
    <div className={styles.signinContainer}>

      {/* Sign In Head */}
      <div className={`${styles.signinHead}`}>
        <h1>SignIn</h1>
      </div>
     
    </div>
  );
};

export default SignIn;
